(15/10/1988 - 15/10/2018)

BCH Đoàn trường THPT Chuyên Thái Nguyên xin chân thành cảm ơn sự hợp tác của các chi đoàn K29, K30; cùng sự giúp đỡ nhiệt tình của các bạn cựu học sinh, các giáo sinh thực tập, studio RAINSEPT đã góp phần làm cho buổi xếp hình này thành công tốt đẹp.

Chúng ta hãy cùng nhau chào đón lễ niệm 30 ngày truyền thống nhà trường được tổ chức vào ngày 12-13/10/2018.
